function AddDataModal({ onClose, onAddData }) {
    const [newData, setNewData] = useState({
      id: "",
      name: "",
      email: "",
      phone: "",
    });

    const handleChange = (e) => {
      const { name, value } = e.target;
      setNewData((prev) => ({ ...prev, [name]: value }));
    };

    const handleSubmit = (e) => {
      e.preventDefault();
      onAddData(newData);
      onClose(); // 데이터 추가 후 모달을 닫기 위해 onClose 호출
    };

    return (
      <form onSubmit={handleSubmit}>
        <label>
          ID:
          <input
            type="text"
            name="id"
            value={newData.id}
            onChange={handleChange}
          />
        </label><br />
        <label>
          이름:
          <input
            type="text"
            name="name"
            value={newData.name}
            onChange={handleChange}
          />
        </label><br />
        <label>
          Email:
          <input
            type="email"
            name="email"
            value={newData.email}
            onChange={handleChange}
          />
        </label><br />
        <label>
          Phone:
          <input
            type="text"
            name="phone"
            value={newData.phone}
            onChange={handleChange}
          />
        </label><br />
        <button type="submit">추가</button>
      </form>
    );
  }
